def main():
    s = input().strip()
    n = len(s)

    # Initialize DP table: dp[i][j] = longest palindromic suffix for s[i:j+1]
    dp = [[0] * n for _ in range(n)]

    # All single characters are palindromes
    for i in range(n):
        dp[i][i] = 1

    # Check all substrings of length 2 to 4 (since we need at least 2 characters for a palindrome)
    for length in range(2, 5):
        for start in range(n - length + 1):
            end = start + length - 1
            if s[start] == s[end]:
                dp[start][end] = dp[start + 1][end - 1] + 2
            else:
                dp[start][end] = max(dp[start + 1][end], dp[start][end - 1])

    # Find the maximum value in the DP table
    result = max(max(row) for row in dp)
    print(result)

