    visited = [False] * (n+1)
    comp = []
    for i in range(1, n+1):
        if not visited[i]:
            component = []
            stack = [i]
            while stack:
                node = stack.pop()
                if not visited[node]:
                    visited[node] = True
                    component.append(node)
                    for neighbor in adj[node]:
                        stack.append(neighbor)
            comp.append(component)

    # Assign numbers to components
    num_to_comp = {}
    for i, comp_list in enumerate(comp):
        for node in comp_list:
            num_to_comp[node] = i

